import React from "react";

function EmptyCommentPopup(props) {

    function insidePopup() {
        return (
            <div className="popup">
                <div className="popup-inner">
                    <p>You can't leave error name and content parts empty, try again.</p>
                    <br></br><br><br></br></br>
                    <button type="button" className="btn btn-danger" onClick={() => props.setTrigger(false)}>Close</button>
                </div>
            </div>
        )
    }

    return (
        <div>
            {props.openPopup ? insidePopup() : null}
        </div>
    )
}

export default EmptyCommentPopup;
